    public int shortestPathBinaryMatrix(int[][] grid) {
        int rows = grid.length;
        if (grid[0][0] == 1 || grid[rows - 1][rows - 1] == 1) return -1;
                if (rows == 1) {
                    if(grid[0][0] == 0)
                    return 1;
                    else{
                        return -1;
                    }
                }

        int distance = 0;
        Queue<Pair<Integer, Integer>> q = new LinkedList<>();
        grid[0][0] = 1;
        q.add(new Pair<>(0, 0));

        while (!q.isEmpty()) {

            int size = q.size();
            distance++;
            while (size != 0) {
                Pair<Integer, Integer> pair = q.poll();
                if (pair.getKey() == grid.length - 1 && pair.getValue() == grid.length - 1) return distance;


                for (int i = 1; i >= -1; i--) {
                    for (int j = 1; j >= -1; j--) {
                        if (isValidIndex(pair.getKey() + i, pair.getValue() + j, rows)
                                && grid[pair.getKey() + i][pair.getValue() + j] == 0) {
                            q.add(new Pair<>(pair.getKey() + i, pair.getValue() + j));
                            grid[pair.getKey() + i][pair.getValue() + j] = 1;
                        }
                    }
                }
                size--;
            }
        }
        return -1;
    }

